`,v(t.p,{children:"This recipe can easily be frozen before cooking- Just place them out on a silicone mat and put in the freezer for 30 minutes, until solid. After that, they can be moved to a ziploc bag or tupperware container without sticking together, and taken out as needed. Just bake an additional 1-2 minutes."}),`
